import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import styles from "./Leaderboard.module.scss";




const useStyles = makeStyles({
  table: {
    minWidth: 500,
  },
});

function createData(username, numClients, numProjects, total) {
  return { username, numClients, numProjects, total };
}

const rows = [
  createData('Frozen yoghurt', 1, 6, 2400),
  createData('Ice cream sandwich', 2, 4, 1800),
  createData('Eclair', 0, 0, 0),
  createData('Cupcake', 0, 0, 0),
  createData('Gingerbread', 0, 0, 0),
];

export default function Leaderboard() {
  const classes = useStyles();

  return (
  	<>
	<div>

	<span>Affiliates: 5</span>
	<span>Clients: 8</span>
	<span>Projects: 8</span>
	<span>Money received: 4200</span>
	<span>1st prize: 168</span>
	<span>Money received: 4200</span>
	<span>Money received: 4200</span>
	</div>

    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Affiliate</TableCell>
            <TableCell align="right">Number of Clients</TableCell>
            <TableCell align="right">Number of Projects</TableCell>
            <TableCell align="right">Total($)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.username}>
              <TableCell component="th" scope="row">
                {row.username}
              </TableCell>
              <TableCell align="right">{row.numClients}</TableCell>
              <TableCell align="right">{row.numProjects}</TableCell>
              <TableCell align="right">{row.total}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </>
  );
}
